var ctx = {
    succeed: function(mess) {
        console.log('SUCCESS', mess);
    },
    fail: function(mess) {
        console.log('FAIL', mess);
    }
};

var token = jwt.sign({
    pseudo: "toto"
}, '§%p3r3c4570r§%');

var ERRORS = [
    'INVALID_CREDENTIALS',
    'CONFLICT',
];

function returnErrorFromCode(code, context) {
    if (code < ERRORS.length) {
        return context.fail(ERRORS[code]);
    }
    else {
        return context.fail('UNKNOWN');
    }
}

exports.authenticate = authenticate = function(event, context) {
    if (!(event.pseudo && event.password)) {
        returnErrorFromCode(0, context);
    }
    UserController.login(event.pseudo, event.password, function(err, res) {
        if (err) {
            return context.fail(err);
        }
        else {
            if (typeof res == 'number') {
                returnErrorFromCode(res, context);
            }
            else {
                return context.succeed({
                    authorized: true,
                    result: {
                        token: res.token
                    }
                });
            }
        }
    });
};

